import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';

// Import your components
import Layout from './components/Layout/Layout';
import Home from './pages/Home/Home';
import About from './pages/About/About';
import Services from './pages/Services/Services';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Dashboard from './pages/Dashboard/Dashboard';
import NotFound from './pages/NotFound/NotFound';

// Import your styles
import './styles/globals.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Routes with Layout (Header/Footer) */}
            <Route path="/" element={<Layout />}>
              <Route index element={<Home />} />
              <Route path="about" element={<About />} />
              <Route path="services" element={<Services />} />
              <Route path="services/:category" element={<Services />} />
              <Route path="careers" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Careers</h1><p>Coming soon...</p></div></div>} />
              <Route path="blog" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Blog</h1><p>Coming soon...</p></div></div>} />
              <Route path="contact" element={<div className="py-20"><div className="container px-4 mx-auto"><h1 className="text-4xl font-bold">Contact Us</h1><p>Coming soon...</p></div></div>} />
              <Route path="dashboard" element={<Dashboard />} />
            </Route>
            
            {/* Routes without Layout (Auth pages) */}
            <Route path="login" element={<Login />} />
            <Route path="register" element={<Register />} />
            
            {/* 404 Route */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
